// SPDX-License-Identifier: MIT
pragma solidity 0.8.17;

contract Escrow {
    address public arbiter;
    address public beneficiary;
    address public depositor;

    bool public isApproved;
    bool public isCancelled;

    enum escrowStatus {
        Open,
        Operating,
        Fulfilled,
        Cancelled
    }

    escrowStatus public statusEscrow;

    constructor(address _arbiter, address _beneficiary) payable {
        arbiter = _arbiter;
        beneficiary = _beneficiary;
        depositor = msg.sender;
        statusEscrow = escrowStatus.Open;
    }

    event Approved(uint);

    function startOperating() public {
        require(
            msg.sender == beneficiary,
            "Only the beneficiary can call this function!"
        );
        statusEscrow = escrowStatus.Operating;
    }

    function approve() external {
        require(msg.sender == arbiter);
        uint balance = address(this).balance;
        (bool sent, ) = payable(beneficiary).call{value: balance}("");
        require(sent, "Failed to send Ether");
        emit Approved(balance);
        statusEscrow = escrowStatus.Fulfilled;
    }

    function contractMoney() public view returns (uint) {
        return address(this).balance;
    }

    function cancelEscrow() public {
        require(
            msg.sender == arbiter,
            "Contract has been cancelled as the beneficiary has not fulfilled the services"
        );
        statusEscrow = escrowStatus.Cancelled;
    }

    function withdrawMoney() public payable {
        require(
            statusEscrow == escrowStatus.Cancelled && msg.sender == depositor,
            "The beneficiary has not fulfilled the circumstances"
        );
        (bool success, ) = depositor.call{value: address(this).balance}("");
        require(success);
    }
}

